INSERT INTO `movies` VALUES ('1', '1;', '10', 'X战警：逆转未来', '0.0000', '3', '故事的设定发生在当下，变种人族群遭到了前所未有的毁灭性打击，而这一切的根源是“魔形女”瑞文（詹妮弗·劳伦斯 Jennifer Lawrence 饰）在1973年刺杀了玻利瓦尔·特拉斯克（彼特·丁拉基 Peter Dinklage 饰）。在得知“幻影猫”（艾伦·佩吉 E llen Page 饰）利用穿越时空的能力帮助Blink（范冰冰 饰）等战友逃脱巨型机器人“哨兵”的追杀后，X教授（帕特里克·斯图尔特 Patrick Stewart 饰）和万磁王（伊恩·麦克莱恩 Ian McKellen 饰）达成认同，决定让金刚狼（休·杰克曼 Hugh Jackman 饰）穿越回1973年，找到年轻的X教授（詹姆斯·麦卡沃伊 James McAvoy 饰）和年轻的万磁王（迈克尔·法斯宾德 Michael Fassbender 饰）并说服他们一起阻止魔形女的行动。于是，金刚狼踏上了回到过去的旅程，但是命运会不会发生逆转，任何人都无从知晓。', null, '24.00', '1', '2018-12-09 20:02:56', '123', '/merHeadCreateImage/2/f/7CD5945E6B984C4195E2728DE3374027_4.mp4', '国产3D');
INSERT INTO `movies` VALUES ('2', '1;', '10', '变形金刚5最后的骑士', '0.0000', '0', '《变形金刚5：最后的骑士》打破了《变形金刚》系列的核心故事，重新定义了人们心目中的英雄形象。人类和变形金刚开战，擎天柱失踪，拯救未来的关键就埋藏在历史的秘密之中，那是地球上变形金刚的历史。拯救世界的责任落在一支非同寻常的队伍身上：凯德·伊格尔（马克·沃尔伯格饰）、大黄蜂、一位英国爵士（安东尼·霍普金斯饰）还有一位牛津大学教授（劳拉·哈德克饰）。 每个人一生中都会遇到这样一个时刻，它召唤着我们去改变世界。在《变形金刚5：最后的骑士》中，一直被追捕的人将成为英雄，英雄会变成反派。我们和他们的世界，只能存活一个。', null, '24.00', '1', '2018-12-09 20:05:57', '132', '/merHeadCreateImage/2/f/6834E733D967476582017D989BF7705F_4.mp4', '国产3D');
INSERT INTO `movies` VALUES ('3', '1;', '10', '复仇者联盟3无限战争', '0.0000', '2', '《复仇者联盟3：无限战争》是漫威电影宇宙10周年的历史性集结，将为影迷们带来史诗版的终极对决。面对灭霸突然发起的闪电袭击，复仇者联盟及其所有超级英雄盟友必须全力以赴，才能阻止他对全宇宙造成毁灭性的打击。', null, '24.00', '1', '2018-12-09 20:07:48', '147', '/merHeadCreateImage/2/f/58FCBED91AE84986A3C156064630A063_4.mp4', '国产3D');
INSERT INTO `movies` VALUES ('4', '1;', '10', '巨齿鲨', '0.0000', '0', '一项由中国主导的国际科研项目，正在马里亚纳海沟深处进行时，遭遇未知生物攻击，科研人员被困海底。前美国海军陆战队深海潜水专家乔纳斯·泰勒受命前往营救，再度遭遇数年前曾经在深海给自己留下终身难以磨灭记忆的史前生物巨齿鲨。乔纳斯联手科研项目中的中国女科学家张苏茵成功营救了被困人员，但营救行动却意外造成了巨齿鲨逃离深海。当史前巨兽重返浅海，人类将为自己对大自然的贪婪付出惨重的代价......', null, '24.00', '1', '2018-12-09 20:09:20', '132', '/merHeadCreateImage/2/f/7D6B38FDC6254CC6961DFE2F13CE477E_4.mp4', '国产3D');
INSERT INTO `movies` VALUES ('5', '1;', '10', '狂暴巨兽', '0.0000', '0', '巨石强森饰演的灵长类动物学家一直与人类保持距离, 却跟极为聪明的银背大猩猩乔治有着深厚的感情。但是一次基因实验出错, 让这只温驯的大猩猩变成狂怒难驯的庞然巨兽。更可怕的是, 其他动物也发生了同样基因异变。他必须阻止这场全球性的灾难, 更重要是要拯救他的好友乔治。', null, '24.00', '1', '2018-12-09 20:10:26', '132', '/merHeadCreateImage/5/9/1490F47405B84B3184424620A8503C2E_33.mp4', '国产3D');
INSERT INTO `movies` VALUES ('6', '1;', '10', '神奇女侠', '0.0000', '2', '戴安娜（盖尔·加朵 Gal Gadot 饰）是女王希波吕忒（康妮·尼尔森 Connie Nielsen 饰）的女儿，自幼生活在天堂岛上。巨大的屏障将这座岛屿同外界的纷纷扰扰隔开犹如一个世外桃源，而岛上生活着的亦都是女性。在女武官安提奥普（罗宾·莱特 Robin Wright 饰）的教导之下，戴安娜习得了高强的武艺，而她的体内，似乎隐藏着某种强大的未知力量。 一场意外中，一位名为史蒂夫（克里斯·派恩 Chris Pine 饰）的男子来到了岛上，从他口中，戴安娜得知外面的世界正在经历战争的磨难，而造成这一切的罪魁祸首，是战神阿瑞斯（大卫·休里斯 David Thewlis 饰）。为了拯救人类于水火之中，戴安娜依然拿起了长剑与盾牌，发誓要彻底摧毁阿瑞斯的阴谋。', null, '24.00', '1', '2018-12-09 20:12:36', '123', '/merHeadCreateImage/2/e/1FEF4A66DAB945ACAA2D3116CFF7F60F_3.mp4', '国产3D');
INSERT INTO `movies` VALUES ('7', '1;', '10', '头号玩家', '0.0000', '3', '故事发生在2045年，虚拟现实技术已经渗透到了人类生活的每一个角落。詹姆斯哈利迪（马克·里朗斯 Mark Rylance 饰）一手建造了名为“绿洲”的虚拟现实游戏世界，临终前，他宣布自己在游戏中设置了一个彩蛋，找到这枚彩蛋的人即可成为绿洲的继承人。要找到这枚彩蛋，必须先获得三把钥匙，而寻找钥匙的线索就隐藏在詹姆斯的过往之中。 韦德（泰尔·谢里丹 Tye Sheridan 饰）、艾奇（丽娜·维特 Lena Waithe 饰）、大东（森崎温 饰）和修（赵家正 饰）是游戏中的好友，和之后遇见的阿尔忒弥斯（奥利维亚·库克 Olivia Cooke 饰）一起，五人踏上了寻找彩蛋的征程。他们所要对抗的，是名为诺兰索伦托（本·门德尔森 Ben Mendelsohn 饰）的大资本家', null, '24.00', '1', '2018-12-09 20:15:20', '132', '/merHeadCreateImage/2/f/823C126242B342E6A2648B1051D39C39_4.mp4', '国产3D');
INSERT INTO `movies` VALUES ('8', '1;', '10', '正义联盟', '0.0000', '7', '受到超人无私奉献的影响，蝙蝠侠重燃了对人类的信心，接受了新盟友——神奇女侠（戴安娜·普林斯）的帮助，去对抗更加强大的敌人。蝙蝠侠和神奇女侠一同寻找并招募了一支超人类联盟来抵挡新觉醒的威胁。但尽管这支队伍集结了超人、蝙蝠侠、神奇女侠、闪电侠、海王和钢骨等人，他们似乎无法阻止敌人对地球的进攻……\r\n立即播放手机观看', null, '24.00', '1', '2018-12-09 20:18:27', '132', '/merHeadCreateImage/2/f/4B3A2994A7184CBA9CEDF7802755E4B0_4.mp4', '国产3D');
INSERT INTO `movies` VALUES ('9', '1;2;', '10', '蜘蛛侠英雄归来', '0.0030', '166', '彼得帕克（汤姆·赫兰德 Tom Holland 饰）在内战后受到了钢铁侠托尼斯塔克（小罗伯特·唐尼 Robert Downey Jr. 饰）的赏识，表面上，彼得进入托尼的公司成为了一名实习生，实际上，他和复仇者联盟的成员们一起接受了各种各样的训练。托尼虽然欣赏彼得的勇敢和正直，却并不认为他目前已经拥有加入复联的实力，他派出了特工哈皮（乔恩·费儒 Jon Favreau 饰）暗中观察，这让十分想证明自己的彼得感到万分焦躁。 在对付两个银行劫匪的过程中，彼得发现劫匪们使用的是一种前所未见的新型武器，他孤身一人深入敌后顺藤摸瓜找到了幕后主使秃鹰（迈克尔·基顿 Michael Keaton 饰），让他彼得没有想到的是，秃鹰竟然是他爱慕的女生利兹（劳拉·海瑞尔 Laura Harrier 饰）的父亲', null, '24.00', '1', '2018-12-09 20:20:54', '132', '/merHeadCreateImage/3/0/BD4AD9C83EDB4DB0A2871094330363DE_5.mp4', '国产3D');
INSERT INTO `movies` VALUES ('10', '1;', '10', '侏罗纪世界2', '0.0000', '4', '自侏罗纪世界的骚乱以来，种类繁多的恐龙在努布拉岛度过了三年无拘无束的时光。然而该岛火山活动频繁，随时有喷发的危险。致力于恐龙保护的克莱尔·戴宁（布莱丝·达拉斯·霍华德 Bryce Dallas Howard 饰）受到班杰明•洛克伍德的邀请。班杰明及其下属伊莱·米尔斯（拉菲·斯波 Rafe Spall 饰）希望她和相关技术人员前往努布拉岛拯救那里的恐龙，并将它们安置在新的栖息地。受到感染的克莱尔设法找来欧文（克里斯·帕拉特 Chris Pratt 饰）一同前往，欧文则希望救出他亲手驯养的迅猛龙小蓝。当他们踏足这座隔绝之岛时，却发现事情没那么简单。 火山蠢蠢欲动，随时爆发，而混乱之中丑恶的阴谋悄然酝酿…', null, '24.00', '1', '2018-12-09 20:23:53', '132', '/merHeadCreateImage/2/f/3D297ECB1C2A4EECA144BF153F774AA9_4.mp4', '国产3D');
